// PenaltÄ± haritasÄ±na geÃ§iÅŸ ve tÃ¼m oyuncularÄ± Spectator yapma
function startPenaltyShootout() {
    room.setCustomStadium(map4);  // PenaltÄ± haritasÄ±
    room.sendAnnouncement("Skor eÅŸit! PenaltÄ±lar baÅŸlÄ±yor. Her oyuncuya 10 saniye verilecek.", null, 0xFFFF00, 'bold', 2);
    
    // TÃ¼m oyuncularÄ± spectator yapÄ±yoruz
    let players = room.getPlayerList();
    for (let player of players) {
        room.setPlayerTeam(player.id, 0);  // Spectator yap
    }
    
    // TakÄ±mlardan birer oyuncu seÃ§
    let redPlayers = players.filter(player => player.team === 1);
    let bluePlayers = players.filter(player => player.team === 2);

    if (redPlayers.length > 0 && bluePlayers.length > 0) {
        penaltyPlayers.red = redPlayers[0];  // KÄ±rmÄ±zÄ± takÄ±mdan bir oyuncu seÃ§
        penaltyPlayers.blue = bluePlayers[0];  // Mavi takÄ±mdan bir oyuncu seÃ§
    }

    // SeÃ§ilen oyunculara 10 saniye sÃ¼re ver
    startPenaltyTimer();
}


// PenaltÄ± atÄ±ÅŸÄ±na baÅŸlama fonksiyonu
function startPenaltyTimer() {
    penaltyTimer = setInterval(function () {
        // Her oyuncuya 10 saniye verilecek
        if (penaltyScores.red >= 3 || penaltyScores.blue >= 3) {
            // EÄŸer bir takÄ±m 3 fark attÄ±ysa kazananÄ± aÃ§Ä±klÄ±yoruz
            endPenaltyShootout();
        } else {
            room.sendAnnouncement("PenaltÄ± atÄ±ÅŸlarÄ± devam ediyor.", null, 0xFFFFFF, 'bold', 2);
            // KÄ±rmÄ±zÄ± takÄ±mdan oyuncu atÄ±ÅŸÄ± yapacak
            if (penaltyScores.red < 3 && penaltyScores.blue < 3) {
                room.sendAnnouncement(penaltyPlayers.red.name + "'un atÄ±ÅŸÄ± iÃ§in 10 saniye kaldÄ±.", null, 0xFF0000, 'bold', 2);
            }
            // Mavi takÄ±mdan oyuncu atÄ±ÅŸÄ± yapacak
            if (penaltyScores.red < 3 && penaltyScores.blue < 3) {
                room.sendAnnouncement(penaltyPlayers.blue.name + "'un atÄ±ÅŸÄ± iÃ§in 10 saniye kaldÄ±.", null, 0x0000FF, 'bold', 2);
            }
        }
    }, 10000);  // 10 saniyede bir

}

// PenaltÄ± sÃ¼reci sonlandÄ±rma
function endPenaltyShootout() {
    // PenaltÄ±lar sona erdi, skoru ve kazananÄ± aÃ§Ä±klÄ±yoruz
    clearInterval(penaltyTimer);
    
    if (penaltyScores.red > penaltyScores.blue) {
        room.sendAnnouncement("ðŸ”´ KÄ±rmÄ±zÄ± TakÄ±m KazandÄ±! Skor: " + penaltyScores.red + " - " + penaltyScores.blue, null, 0xFF0000, 'bold', 2);
    } else if (penaltyScores.blue > penaltyScores.red) {
        room.sendAnnouncement("ðŸ”µ Mavi TakÄ±m KazandÄ±! Skor: " + penaltyScores.blue + " - " + penaltyScores.red, null, 0x0000FF, 'bold', 2);
    } else {
        room.sendAnnouncement("PenaltÄ± Sonucu EÅŸit! Skor: " + penaltyScores.red + " - " + penaltyScores.blue, null, 0xFFFF00, 'bold', 2);
    }

    // TÃ¼m oyuncularÄ± tekrar takÄ±mlarÄ±na yerleÅŸtiriyoruz
    let players = room.getPlayerList();
    for (let player of players) {
        if (player.team === 0) {
            // EÄŸer oyuncu spectator ise, takÄ±ma yerleÅŸtir
            if (penaltyScores.red > penaltyScores.blue) {
                room.setPlayerTeam(player.id, 1);  // KÄ±rmÄ±zÄ±
            } else {
                room.setPlayerTeam(player.id, 2);  // Mavi
            }
        }
    }

    // SkorlarÄ± sÄ±fÄ±rla
    penaltyScores = { red: 0, blue: 0 };
    penaltyPlayers = { red: null, blue: null };
}
